              <TableCell align="center"> Tuyến đường vi phạm </TableCell>
              {/* <TableCell align="center"> Loại Phương Tiện </TableCell> */}
            </TableRow>
          </TableHead>
          <TableBody>
            {vehicle.map((historyRow) => (
              <TableRow
                onClick={(e) => itemActive(e, historyRow)}
                className={
                  props.Infowindow.lat === historyRow.lat &&
                    props.Infowindow.lng === historyRow.lng
                    ? classes.tablerow
                    : classes.untablerow
                }
              >
                <TableCell align="center" className={classes.tablecell}>
                  <img src={historyRow.image} className={classes.imagepopup}></img>
                </TableCell>
                <TableCell align="left">
                  <b className={classes.font}>{historyRow.vehicle}</b>

                  <Typography variant="body1" color="textSecondary" className={classes.colorfont}> {historyRow.typeVehicle}</Typography>
                </TableCell>
                <TableCell align="left">
                  <Typography  className={classes.font}>{historyRow.type}</Typography>
                  <Typography variant="body1" color="textSecondary" className={classes.colorfont}>{historyRow.date}</Typography>
                </TableCell>
                {/* <TableCell align="center">{historyRow.date}</TableCell> */}
                <TableCell align="left"><Typography  className={classes.font}>{historyRow.stress}</Typography></TableCell>
                {/* <TableCell align="center">{historyRow.Processingunit}</TableCell> */}
                {/* <TableCell align="center">{historyRow.typeVehicle}</TableCell> */}
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </div>
      <div className={classes.pagination}>
        <Pagination
          count={100000}
          showFirstButton
          showLastButton
          // onChange={onChange}
          siblingCount={1}
        />
      </div>
    </>
  );
}

